function drawRoom(drawFloors, drawWalls) {

	var arrayIndex = 0;
	var drawTileX = 0;
	var drawTileY = 0;
	shinyAngle += shinyAngleDelta;

	for(var eachRow = 0; eachRow < ROOM_ROWS; eachRow++) {
		for(var eachCol = 0; eachCol < ROOM_COLS; eachCol++) {

			var arrayIndex = rowColToArrayIndex(eachCol, eachRow);
			var tileKindHere = roomGrid[arrayIndex];
			var useImg = worldPics[tileKindHere];

			if( tileTypeHasTransparency(tileKindHere) ) {
				canvasContext.drawImage(worldPics[TILE_ROAD], drawTileX, drawTileY);
			}
			if( tileTypeHasGrassTransparency(tileKindHere) ) {
				canvasContext.drawImage(worldPics[TILE_GRASS], drawTileX, drawTileY);
			}
			if( tileTypeHasBarFloorTransparency(tileKindHere) ) {
				canvasContext.drawImage(worldPics[TILE_BAR_FLOOR1], drawTileX, drawTileY);
			}
			

			var isFloor = tileIsAFloor(tileKindHere);

			if (drawFloors && isFloor ||
				drawWalls && !isFloor) {
				try {

					// draw the tile
					canvasContext.drawImage(useImg, drawTileX, drawTileY);
					
					// optional sparkles, splashes, glows are drawn on top
					drawTileFX(tileKindHere, drawTileX, drawTileY);


				} catch (err) {
					console.log("Got the error " + err + " when trying to draw " + useImg);
				}

			}

			// edit mode highlight
			if (tileEditor && arrayIndex==tileSelected) {
				canvasContext.beginPath();
				canvasContext.lineWidth = "1";
				canvasContext.strokeStyle = "red";
				canvasContext.rect(drawTileX+1, drawTileY+1, TILE_W-1, TILE_H-1);
				canvasContext.stroke();
			}

			drawTileX += TILE_W;
			arrayIndex++;
		} // end of for each col
		drawTileY += TILE_H;
		drawTileX = 0;
	} // end of for each row

	// TODO: why is this here? -- Vince's response: This was meant for when the player enters a new map area.
	// fadingTitles.begin("COOL MESSAGE","headline","subtitle");
}

function redrawMinimapTiles() {

	// draw minimap background
	minimapContext.fillStyle = '#7e4e35';
	minimapContext.fillRect(0,0, minimapCanvas.width, minimapCanvas.height);

	let drawTileX = 0;
	let drawTileY = 0;

	for(let eachRow = 0; eachRow < ROOM_ROWS; eachRow++) {
		for(let eachCol = 0; eachCol < ROOM_COLS; eachCol++) {

			let arrayIndex = rowColToArrayIndex(eachCol, eachRow);
			let tileKindHere = roomGrid[arrayIndex];

			if (tileKindHere === 17) {
				tileKindHere = 901;
				minimapContext.fillStyle = '#0000ff';	
			} else if (tileKindHere === 18) {
				minimapContext.fillStyle = '#008000';
			} else if (tileKindHere === 0) {
				minimapContext.fillStyle = '#8c8c35';
			} else {
				minimapContext.fillStyle = "#b97a57";
			}

			minimapContext.fillRect(drawTileX,drawTileY, 4,4);

			drawTileX += 4;
			arrayIndex++;
		}
		drawTileY += 4;
		drawTileX = 0;
	} 
}

function drawMiniMap(miniMapPosX,miniMapPosY, width,height, miniMapTileSize) {
	const tileCountX = Math.floor(width/miniMapTileSize); // how many tiles is the mini map
	const tileCountY = Math.floor(height/miniMapTileSize);
	const warrTilePosXOnMap = Math.floor(redWarrior.x/TILE_W); // tile position of the warrior
	const warrTilePosYOnMap = Math.floor(redWarrior.y/TILE_H);
	
	canvasContext.fillStyle = '#7e4e35';
	canvasContext.fillRect(miniMapPosX,miniMapPosY, width, height);
	
	canvasContext.drawImage(minimapCanvas, warrTilePosXOnMap*4-width/2,warrTilePosYOnMap*4-height/2, width, height,
		miniMapPosX, miniMapPosY, width, height);
		
	const warrPic = getMiniMapPlayerIcon();
	rotateAndPaintImage(canvasContext, playerMiniMap, warrPic,miniMapPosX+90+2, miniMapPosY+90+2, 4,6);
	const strokeWidth = 6;
	emptyRect(miniMapPosX,miniMapPosY, width-strokeWidth/2,height-strokeWidth/2, strokeWidth, "#000");
	emptyRect(miniMapPosX+1,miniMapPosY+1, width-strokeWidth/2-2,height-strokeWidth/2-2, 1, "#FFF");
}

function getMiniMapPlayerIcon() {
	return Math.atan2(redWarrior.rotation.y, redWarrior.rotation.x);
}

function tileIsAFloor(tileKind) {
	return (tileKind <= TERRAIN_TILE_NUM_MAX);
}

function drawOnlyTilesOnScreen() {
	var cameraLeftMostCol = Math.floor(camera.x / TILE_W);
	var cameraTopMostRow = Math.floor(camera.y / TILE_H);
	var colsThatFitOnScreen = Math.floor(canvas.width / TILE_W);
	var rowsThatFitOnScreen = Math.floor(canvas.height / TILE_W);
	var cameraRightMostCol = cameraLeftMostCol + colsThatFitOnScreen + 2;
	var cameraBottomMostRow = cameraTopMostRow + rowsThatFitOnScreen + 1;

	var arrayIndex = 0;
	var drawTileX = 0;
	var drawTileY = 0;

	for(var eachCol = cameraLeftMostCol; eachCol < cameraRightMostCol; eachCol++) {
		for(var eachRow = cameraTopMostRow; eachRow < cameraBottomMostRow; eachRow++) {

			var arrayIndex = rowColToArrayIndex(eachCol, eachRow);
			var tileKindHere = roomGrid[arrayIndex];
			var useImg = worldPics[tileKindHere];

			if( tileTypeHasTransparency(tileKindHere) ) {
				canvasContext.drawImage(worldPics[TILE_ROAD], drawTileX, drawTileY);
			}
			
			if( tileTypeHasBarFloorTransparency(tileKindHere) ) {
				canvasContext.drawImage(worldPics[TILE_ROAD], drawTileX, drawTileY);
			}
			

			if (drawTileX <= 32) {
			//canvasContext.drawImage(useImg, drawTileX, drawTileY);
			drawTileX += TILE_W;
			arrayIndex++;
			}
		}
	}
}

